import React, { useState } from 'react';
import { Container, Box, Drawer, List, ListItem, ListItemText, Typography, Divider, Button, IconButton } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu'; // Import MenuIcon for the toggle button
import ChevronLeftIcon from '@mui/icons-material/ChevronLeft'; // Import icon for hiding the sidebar

const drawerWidth = 240;

function Teacherinterface() {
  const [selectedSection, setSelectedSection] = useState('Courses');
  const [open, setOpen] = useState(true); // State to control sidebar visibility
  const navigate = useNavigate();

  const handleSectionChange = (section) => {
    setSelectedSection(section);
  };

  const handleLogout = () => {
    // Implement logout logic here
    navigate('/login'); // Redirect to login page or wherever necessary
  };

  const handleDrawerToggle = () => {
    setOpen(!open); // Toggle the sidebar visibility
  };

  return (
    <Box sx={{ display: 'flex' }}>
      {/* Navbar Button */}
      <Box sx={{ position: 'fixed', top: 0, left: 0, width: '100%', bgcolor: 'primary.main', color: 'white', p: 1 }}>
        <IconButton color="inherit" onClick={handleDrawerToggle}>
          {open ? <ChevronLeftIcon /> : <MenuIcon />}
        </IconButton>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1, ml: 2 }}>
          Teacher Dashboard
        </Typography>
      </Box>

      <Drawer
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
            display: open ? 'block' : 'none', // Show or hide the sidebar based on `open` state
          },
        }}
        variant="persistent"
        anchor="left"
        open={open}
      >
        <List>
          <ListItem button onClick={() => handleSectionChange('Courses')}>
            <ListItemText primary="Courses" />
          </ListItem>
          <ListItem button onClick={() => handleSectionChange('Assignments')}>
            <ListItemText primary="Assignments" />
          </ListItem>
          <ListItem button onClick={() => handleSectionChange('Other')}>
            <ListItemText primary="Other" />
          </ListItem>
          <Divider />
          <ListItem button onClick={handleLogout}>
            <ListItemText primary="Logout" />
          </ListItem>
        </List>
      </Drawer>

      <Box
        component="main"
        sx={{ flexGrow: 1, bgcolor: 'background.default', p: 3, ml: open ? drawerWidth : 0 }}
      >
        <Typography variant="h4" gutterBottom>
          {selectedSection}
        </Typography>
        {selectedSection === 'Courses' && (
          <Box>
            <Button variant="contained" color="primary" onClick={() => navigate('/add-course')}>
              Add Course
            </Button>
            <Button variant="contained" color="primary" onClick={() => navigate('/view-courses')}>
              View Courses
            </Button>
            <Button variant="contained" color="primary" onClick={() => navigate('/update-course')}>
              Update Course
            </Button>
            <Button variant="contained" color="primary" onClick={() => navigate('/delete-course')}>
              Delete Course
            </Button>
          </Box>
        )}
        {selectedSection === 'Assignments' && (
          <Typography variant="h6">Assignments Section</Typography>
        )}
        {selectedSection === 'Other' && (
          <Typography variant="h6">Other Section</Typography>
        )}
      </Box>
    </Box>
  );
}

export default Teacherinterface;
